You asked, we listened… kinda. You guys have wanted to see ‘ol Cleetus on this show for quite a while. Unfortunately both of Mr. McFarland’s personal cars that were out on the West Coast were down due to explosions happening where they weren’t supposed to happen… but he was a good sport and borrowed a buddies’ twin turbo ‘Vette to race us in instead. Because he’s an absolute champ. AND… the finish might just surprise you. 

